pragma solidity ^0.4.23;

//import '../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721.sol';
import '../node_modules/openzeppelin-solidity/contracts/token/ERC721/ERC721.sol';

library Library{
    struct data {
        uint256 tokenId;
        bool exists;
    }
}

contract StarNotary is ERC721 { 

    struct Star { 
        string name;
        string dec;
        string mag;
        string cent;
        string story;
    }

    using Library for Library.data;
    mapping(uint256 => Star) public _tokenIdToStarInfo; 
    mapping(address => uint256[]) private _ownerToTokenId; 
    mapping(uint256 => uint256) private _starsForSale;
    mapping(bytes32 => Library.data) private _hashToTokenId;

    Star[] private stars;
    uint256[] tokensForSale;

    function createStar(string _name, string _dec, string _mag, string _cent, string _story) 
    public
    returns(uint256) 
    {
        require(!checkIfStarExist(_dec, _mag, _cent), "Star already registered!");

        bytes32 starHash = genHash(_dec, _mag, _cent);
        Star memory newStar = Star(_name,_dec,_mag,_cent,_story);

        uint256 tokenId = stars.push(newStar) - 1;

        // Library.data memory data;
        // data.tokenId = tokenId;
        // data.exists = true;

        // _hashToTokenId[genHash(_dec, _mag, _cent)] = data;

        _tokenIdToStarInfo[tokenId] = newStar;

        _mint(msg.sender, tokenId);

        return tokenId;

    }

    function putStarUpForSale(uint256 _tokenId, uint256 _price) public { 
        require(this.ownerOf(_tokenId) == msg.sender);

        tokensForSale.push(_tokenId);
        _starsForSale[_tokenId] = _price;
    }

    function buyStar(uint256 _tokenId) public payable { 
        require(_starsForSale[_tokenId] > 0);

        uint256 starCost = _starsForSale[_tokenId];
        address starOwner = this.ownerOf(_tokenId);
        require(msg.value >= starCost);

        _removeTokenFrom(starOwner, _tokenId);
        _addTokenTo(msg.sender, _tokenId);
        delete tokensForSale[_tokenId];

        starOwner.transfer(starCost);

        if(msg.value > starCost) { 
            msg.sender.transfer(msg.value - starCost);
        }
    }

    function genHash(string dec, string mag, string cent) 
    private pure
    returns (bytes32) {
        return keccak256(abi.encodePacked(dec, mag, cent));
    }

    function checkIfStarExist(bytes32 starHash) 
    private view
    returns (bool) {
        return (_hashToTokenId[starHash].exists);
    }

    function checkIfStarExist(string dec, string mag, string cent) 
    public view
    returns (bool) {
        bytes32 starHash = genHash(dec, mag, cent);
        return (checkIfStarExist(starHash));
    }

    // function getLengthStars() public constant returns(uint count) {
    //     return stars.length;
    // }

    // function _addTokenTo(address to, uint256 tokenId) internal {
    //     _ownerToTokenId[msg.sender].push(tokenId);
    //     ERC721._addTokenTo(to, tokenId);
    // }

    function tokenIdToStarInfo(uint256 _tokenId) 
    public view
    returns (
        string name,
        string dec,
        string mag,
        string cent
    )
    {
        require(_tokenId > 0);

        Star memory star = _tokenIdToStarInfo[_tokenId];

        name = star.name;
        dec = string(abi.encodePacked("dec_", star.dec)); 
        mag = string(abi.encodePacked("mag_", star.mag)); 
        cent = string(abi.encodePacked("cent_", star.cent)); 
    }

    function starsForSale() 
    public view
    returns (uint256[])
    {
        return tokensForSale;
    }
}
